        private async Task<string> PostFormDataAsync()
        {
            var res = "";
            HttpClient _httpClient = new HttpClient();
            var postContent = new MultipartFormDataContent();
            string boundary = string.Format("--{0}", DateTime.Now.Ticks.ToString("x"));
            postContent.Headers.Add("ContentType", $"multipart/form-data, boundary={boundary}");
            var requestUri = "http://top.mohoo.club/api/faceMySearch";
            #region 脸部照片base64编码
            var faceImg = @"";
            #endregion
            var values = new[]
            {
                 new KeyValuePair<string, string>("venueKey","ring123"),
                 new KeyValuePair<string, string>("headImg",faceImg)
                 };

            foreach (var keyValuePair in values)
            {
                postContent.Add(new StringContent(keyValuePair.Value),
                    String.Format("\"{0}\"", keyValuePair.Key));
            }

            tbResponse.Text = Regex.Unescape(Post2Bracelet(requestUri, postContent));
            var response = await _httpClient.PostAsync(requestUri, postContent);
            //浏览器出参返回入res
            return response.ToString();

            if (response.IsSuccessStatusCode)
            {
                res = response.Content.ReadAsStringAsync().Result;
            }
            //处理返回JSON数据
        }

        public string Post2Bracelet(string url, Object obj)
        {
   //         string jsonParam = JsonConvert.SerializeObject(obj);
            var request = (HttpWebRequest)WebRequest.Create(url);
            request.Method = "POST";
    //        request.ContentType = "application/json; charset =UTF-8";
            byte[] byteData = Encoding.UTF8.GetBytes(obj.ToString());
            int length = byteData.Length;
            request.ContentLength = length;
            Stream writer = request.GetRequestStream();
            writer.Write(byteData, 0, length);
            writer.Close();
            var response = (HttpWebResponse)request.GetResponse();//使用POST方法发送请求
            return new StreamReader(response.GetResponseStream(), Encoding.GetEncoding("utf-8")).ReadToEnd();
        }

    }
